import SideMenu from '../components/SideMenu';
import '../styles/Price.css';
import reactLogo from '../media/reactLogo.png';
import '../styles/Contact.css';
import Form from 'react-bootstrap/Form';
import FloatingLabel from 'react-bootstrap/FloatingLabel';
import { Button } from 'react-bootstrap';

function Contact() {
  return (
    <div className="page Contact" id="contact">
      <SideMenu page="contact" />
      <div className="contactContainer">
        <h1 className="title primaryColor">Kontakt</h1>
        <h4 className="text-white biggerNormalText">
          so k√∂nnt ihr mich erreichen
        </h4>
        <Form className="test">
          <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
            <Form.Label className="test">Name</Form.Label>
            <Form.Control type="email" placeholder="Max Mustermann" />
          </Form.Group>

          <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
            <Form.Label>Email</Form.Label>
            <Form.Control
              type="email"
              placeholder="maxmustermann@beispiel.com"
            />
          </Form.Group>

          <Form.Group className="mb-3" controlId="exampleForm.ControlTextarea1">
            <Form.Label>Example textarea</Form.Label>
            <Form.Control as="textarea" rows={3} />
          </Form.Group>
          <Button>Senden</Button>
        </Form>
      </div>
      <img src={reactLogo} className=" reactLogo" />
    </div>
  );
}

export default Contact;
